tables.table_schema:
CREATE TABLE phishing_images (
  image_id SERIAL PRIMARY KEY,
  image_url TEXT NOT NULL,
  image_description TEXT
);

CREATE TABLE phishing_screenshots (
  screenshot_id SERIAL PRIMARY KEY,
  screenshot_url TEXT NOT NULL,
  screenshot_date DATE,
  screenshot_notes TEXT
);

CREATE TABLE phishing_pages (
    id UUID PRIMARY KEY,
    url VARCHAR(255) NOT NULL,
    image BYTEA,
    screenshot BYTEA
);

CREATE TABLE user_accounts (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    password VARCHAR(50) NOT NULL
);

CREATE TABLE analysis_results (
    analysis_id UUID PRIMARY KEY,
    attempt_id UUID NOT NULL,
    result_text TEXT,
    result_image BYTEA
);

CREATE TABLE phishing_images (
    id INT PRIMARY KEY,
    image_url TEXT,
    screenshot_url TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE phishing_links (
    id INT PRIMARY KEY,
    link_url TEXT,
    screenshot_url TEXT
);

CREATE TABLE phishing_users (
    user_id SERIAL PRIMARY KEY,
    username TEXT,
    email TEXT,
    password TEXT
);

CREATE TABLE phishing_analysis (
    analysis_id SERIAL PRIMARY KEY,
    report_id INT,
    analysis_date DATE,
    findings TEXT
);
